import React from 'react';
import { OverlayTrigger, Tooltip as BootstrapTooltip } from 'react-bootstrap';

const Tooltip = ({ children, text }) => (
  <OverlayTrigger
      placement="top"
      overlay={<Tooltip id="tooltip">{text}</Tooltip>}
    >
      <div>{children}</div>
    </OverlayTrigger>
);

export default Tooltip;
